export const pointingTuple = {
  name: "Pointing Tuple",
  test: [
    [0, 0, 0, 0, 0, 0, 3, 9, 5],
    [5, 0, 0, 0, 7, 0, 0, 2, 0],
    [0, 0, 0, 6, 0, 5, 7, 1, 0],
    [0, 0, 0, 5, 0, 4, 0, 6, 0],
    [0, 0, 0, 7, 0, 3, 0, 0, 0],
    [0, 4, 5, 0, 0, 0, 0, 0, 0],
    [0, 1, 3, 0, 5, 0, 0, 7, 0],
    [0, 5, 0, 0, 8, 7, 0, 0, 2],
    [2, 0, 7, 0, 0, 0, 0, 0, 0],
  ],
  check: (cell, state) => {
    console.log("pointingTuple" + cell + state);
    return 0;
  },
};
